import styled from "styled-components";

export const CardContainer = styled.div`
  border: 2px solid black;
  width: 200px;
  height: 350px;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 10px;
`;

export const Title = styled.h1`
display: flex;
flex-direction: row
align-items: center
justify-content: center
`
